import React from 'react';
import CardClasses from './card.module.scss';

const Card = () => {
  return (
    <div className={CardClasses.warapper}>
      <div className={CardClasses.picture}></div>
      <div className={CardClasses.info}></div>
    </div>
  );
}

export default Card;
